import { Route, Routes } from "react-router-dom";
import { Container } from "react-bootstrap";
import Home from "./components/pages/Home/Home"
import SinglePost from "./components/pages/SinglePost/SinglePost.js"
import PostAdd from "./components/pages/PostAdd/PostAdd"
import PostEdit from './components/pages/PostEditId/PostEdit';
import About from "./components/pages/About/About"
import Header from "./components/views/Header/Header";
import Footer from "./components/views/Footer/Footer";
import CategoryLinks from "./components/pages/CategoryLinks/CategoryLinks"
import SingleCategory from './components/pages/SingleCategory/SingleCategory';

const App = () => {
  return (
    <Container>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/post/:id" element={<SinglePost />} />
        <Route path="/post/add" element={<PostAdd />} />
        <Route path="/post/edit/:id" element={<PostEdit />} />
        <Route path="/coders" element={<CategoryLinks />} />
        <Route path="/about" element={<About />} />
        <Route path='/category/:category' element={<SingleCategory />} />
      </Routes>
      <Footer />
    </Container>
  );
}
export default App;
